B.zT=new A.aO(6,{desenvolvedor:"Desenvolvedor",sobremimtitulo:"Sobre mim",sobremimtext:"    Atuo no mercado de desenvolvimento de softwares desde 2014, e ao longo desse tempo venho colecionado experiencias em diversas linguagens e ferramentas. Possuo especialidades em desenvolvimento back-end e mobile.\n\n    Busco novas e melhores maneiras de realizar minhas tarefas e criar meus c\xf3digos. E sempre estou pronto para receber uma cr\xedtica ou aprender algo novo. Gosto de manter meus projetos organizados e sempre cumprir prazos.\n\n    Al\xe9m de um desenvolvedor, gosto de praticar esportes como futebol e v\xf4lei, gosto de fazer uma caminhada quando poss\xedvel. F\xe3 de animes, gosto dos \xfaltimos lan\xe7amentos como Demon Slayer e Jujutsu Kaisen. Gosto muito de viajar e j\xe1 conheci a cidade de Toronto no Canada, e tenho sonho de conhecer New York.\n\n    Entre em contato comigo atrav\xe9s das redes sociais. :D\n  ",linguagens:"Linguagens de programa\xe7\xe3o",ferramentas:"Frameworks",outros:"Outros"},B.h0,t.hD)
